import React from 'react'
import { TextField, Container } from '@mui/material';

export default function SignInForm() {
    return (
        <Container maxWidth="sm">
            <TextField id="outlined-basic" placeholder='First Name' label="First Name" variant="outlined" margin='normal'/><br/>
            <TextField id="outlined-basic" placeholder='Last Name' label="Last Name" variant="outlined" margin='normal'/><br/>
            <TextField id="outlined-basic" placeholder='Email Id' label="Email Id" variant="outlined" margin='normal'/><br/>
            <TextField id="outlined-basic" placeholder='Password' label="Password" variant="outlined" margin='normal'/><br/>
            <TextField id="outlined-basic" placeholder='Confirm Password' label="Confirm Password" variant="outlined" margin='normal'/><br/>
            
        </Container>
    )
}
